import LAuREL.Types
import LAuREL.Parser
import LAuREL.Doc
import System.Environment
import Data.Functor
import Data.List

-- mkrle = concat . map (\(a,b) -> if a > 1 then show a ++ [b] else [b]) . map (\xs -> (length xs, head xs)) . groupBy (==)

datas :: String
datas = ""


t (c1:c2:nc) = if c1 `elem` ['1','2','3','4','5','6','7','8','9'] then ((read [c1] :: Int,c2):t nc) else (1,c1):(t (c2:nc)); t [] = []
data Config = Config {
			output :: String,
			otype :: String,
			input :: String
		}

parseArgs :: Config -> [String] -> Config
parseArgs c [] = c
parseArgs c ("-o":o:xs) = 
	parseArgs (c { output = o }) xs
parseArgs c ("-md":xs) = 
	parseArgs (c { otype = "md" }) xs
parseArgs _ ("-h":xs) = 
	error $ "This is the doc generator for LAuREL.\n"++
				"Usage: laura [-h] [-md] [-o output] [file|-]\n"++
				"\t\t-h\t shows this help\n"++
				"\t\t-o\t sets the ouput file (default is stdout)\n"++
				"\t\t-md\t\t outputs markdown (default)\n"++
				"If file equals to -, stdin will be read as input.\n" 
parseArgs _ ("-s":xs) =
	error $ "\n" ++ showme
	where
		showme = dec $ umkrrle datas
		dec [] = []
		dec (u:f)
			|o ['A'] = n '\n'
			|o ['B','C','D','E','F'] = n ' '
			|o ['G','H','I'] = n '@'
			| o ['J','a'] = n '#'
			| o ['b','c','d','e'] = n '\''
			|o ['f','g','h','i','j'] = n ':'
			| o ['k','l','m','n'] = n ';'
			| o ['o','p','q'] = n '+'
			| o ['r','s','t'] = n ','
			| o ['u','v','w'] = n '.'
			| o ['x','y','z'] = n '`'
			where
				o p = u `elem` p 
				n p = p:dec f
		umkrrle = let t (c1:c2:nc) = if c1 `elem` ['1','2','3','4','5','6','7','8','9'] then ((read [c1] :: Int,c2):t nc) else (1,c1):(t (c2:nc)); t [a] = [(1,a)]; t [] = [] in concatMap (uncurry replicate) . t
parseArgs c ["-"] = 
	c { input = "stdin" }
parseArgs c [n] = 
	c { input = n }
parseArgs c _ =
	parseArgs c ["-h"]

main :: IO ()
main = 
	((parseArgs (Config { output = "stdout", otype = "md", input = "stdin" })) <$> getArgs) >>= \config ->
		((if input config == "stdin" then getContents else readFile $ input config) >>= \file -> (
			let 
				parser = parseLAuREL file
				rendered = case otype config of
					"md" -> markdownify $ docify parser
					_ -> error "Internal error"
			in
			if 
				output config == "stdout"
			then 
				putStrLn rendered
			else
				writeFile (output config) rendered))